import React from "react";
import styles from "./Logo.module.css";

function Logo() {
  return (
    <a href="#" className={styles["logo-link"]}>
      <div className={styles["logo"]}>
        <span className={styles["criticize"]}>Criticize</span>
        <span className={styles["it"]}>It</span>
      </div>
    </a>
  );
}
export default Logo;
